import React from "react";

function NoticeCard(props) {
  return (
    <div class="notice-card">
      <div class="notice-cards-items">
        <p>{props.id}</p>
        <div>{props.question}</div>
        <div>{props.answer}</div>
      </div>
    </div>
  );
}

export default NoticeCard;
